import styled from 'styled-components';
import { Button, Input } from '@mui/material';
import { Palette } from './utils/colors';

const LogIn = () => {

    return ( 
    <Auth>
        <AuthForm>
            <h1>Welcome Trader</h1>
            <Input sx={{backgroundColor: Palette.PRIMARY_LIGHT}}id="filled-basic" label="Filled" variant="filled"/>
            <Input id="filled-basic" label="Filled" variant="filled"/>
            <Button> log In</Button>
            <div/>
            <p>Dont have an account? Sign In</p> 
        </AuthForm>
    </Auth>
    );
}

export default LogIn;

const Auth = styled.div`
    position: fixed;
    width: 100%; 
    height: 100%; 
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background-color: rgba(0,0,0,0.5); 
    z-index: 1; 
    cursor: pointer;

    display: flex;
    align-items:center;
    justify-content:center;

`
const AuthForm = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    width: 400px;
    height: 500px;
    padding: 0 10px;
    background-color: white;

    > * {
        margin-bottom: 25px;
    }
`
